<span class="line"><span style="color:#A6ACCD;">在 t</span><span style="color:#89DDFF;">=</span><span style="color:#F78C6C;">120</span><span style="color:#A6ACCD;"> 时，调用 </span><span style="color:#82AAFF;">get</span><span style="color:#A6ACCD;">(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">) ，返回 </span><span style="color:#F78C6C;">50</span><span style="color:#A6ACCD;">。</span></span>
